import React, { useEffect, useState } from 'react';
const Example=()=>{
   const[count,setCount]=useState(0)
      useEffect(()=>{
         document.title="I clicked"+count+"times"
      },[])
      return<>
      Count:{count}
      <h1><button onClick={()=>setCount(prev=>prev+1)}>Incount</button></h1>
      </>
}
   export default Example;
